import React from 'react';
import PropTypes from 'prop-types'

function Food({ name, amount, rating }) {
  return (<div>
    <h3>i love {name}</h3>
    <h4>price is {amount}</h4>
    <h5>{rating}/5.0</h5>
  </div>);
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  price: PropTypes.string.isRequired,
  rate: PropTypes.string.isRequired
}
const favroiteFood = [
  {
    id: 1,
    name: "kimchi",
    price: "high",
    rate: 2.4
  },
  {
    id: 2,
    name: "gimbap",
    price: "chip",
    rate: 3.7
  }
  ,
  {
    id: 3,
    name: "짜장면",
    price: "middium",
    rate: 5.0
  }
];

// function renderFood(dish) {
//   return
// }

function App() {
  return (
    <div >
      {favroiteFood.map(dish =>
        <Food
          key={dish.id}
          name={dish.name}
          amount={dish.price}
          rating={dish.rate}
        />)}
    </div>
  );
}

export default App;
